import React, { useState, useEffect } from "react";
import "./App.css";

function App() {
  const [country, setCountry] = useState("india");
  const [tracks, setTracks] = useState([]);
  const [state, setState] = useState(0);
  useEffect(() => {
    // Update the document title using the browser API
    fetchapi();
  });
  const fetchapi = () => {
    var api =
      "http://ws.audioscrobbler.com/2.0/?method=geo.gettoptracks&country=" +
      country +
      "&api_key=1860cfefc2bccd102f8437ff38667f0f&format=json";
    console.log(api);
    fetch(api)
      .then(function(response) {
        return response.json();
      })
      .then(function(myJson) {
        console.log(myJson.tracks);
        setState(1);
        setTracks(myJson.tracks);
      });
  };

  return (
    <div className="App">
      <h1 className="title">top tracks in {country} </h1>
    </div>
  );
}

export default App;
